<http://data.europa.eu/eli/reg/2018/1999/oj#article14-paragraph1>
  poli:number "1" ;
  poli:type poli:Paragraph ;
  poli:text "By 30 June 2023, and subsequently by 1 January 2033 and every 10 years thereafter, each Member State shall submit to the Commission a draft update of the latest notified integrated national energy and climate plan or shall provide the Commission with reasons justifying why the plan does not require updating." ;
  poli:deadline "2023-06-30" ;
  owl:sameAs <https://eur-lex.europa.eu/legal-content/EN/TXT/?uri=CELEX:32018R1999&qid=1659554334857#d1e2253-01-04-PAR1> .

<http://data.europa.eu/eli/reg/2018/1999/oj#article14-paragraph2>
  poli:number "2" ;
  poli:type poli:Paragraph ;
  poli:text "By 30 June 2024, and subsequently by 1 January 2034 and every 10 years thereafter, each Member State shall submit to the Commission an update of its latest notified integrated national energy and climate plan, unless they have provided reasons why the plan does not require updating pursuant to paragraph 1." ;
  poli:deadline "2024-06-30" ;
  owl:sameAs <https://eur-lex.europa.eu/legal-content/EN/TXT/?uri=CELEX:32018R1999&qid=1659554334857#d1e2253-01-04-PAR2> .

<http://data.europa.eu/eli/reg/2018/1999/oj#article14-paragraph3>
  poli:number "3" ;
  poli:type poli:Paragraph ;
  poli:text "In the update referred to in paragraph 2, each Member State shall modify its national objective, target or contribution with regard to any of the quantified Union objectives, targets or contributions set out in point (a)(1) of Article 4 in order to reflect an increased ambition as compared to that set out in its latest notified integrated national energy and climate plan. In the update referred to in paragraph 2, each Member State shall modify its national objective, target, or contribution with regard to any of the quantified Union objectives, targets or contributions set out in points (a)(2) and (b) of Article 4 only in order to reflect an equal or increased ambition as compared to that set out in its latest notified integrated national energy and climate plan." ;
  owl:sameAs <https://eur-lex.europa.eu/legal-content/EN/TXT/?uri=CELEX:32018R1999&qid=1659554334857#d1e2253-01-04-PAR3> .

<http://data.europa.eu/eli/reg/2018/1999/oj#article14-paragraph4>
  poli:number "4" ;
  poli:type poli:Paragraph ;
  poli:text "Member States shall make efforts to mitigate in their updated integrated national energy and climate plan any adverse environmental impacts that become apparent as part of the integrated reporting pursuant to Articles 17 to 25." ;
  owl:sameAs <https://eur-lex.europa.eu/legal-content/EN/TXT/?uri=CELEX:32018R1999&qid=1659554334857#d1e2253-01-04-PAR4> .

<http://data.europa.eu/eli/reg/2018/1999/oj#article14-paragraph5>
  poli:number "5" ;
  poli:type poli:Paragraph ;
  poli:text "This Article is without prejudice to the provisions of Articles 7, 11 and 13." ;
  owl:sameAs <https://eur-lex.europa.eu/legal-content/EN/TXT/?uri=CELEX:32018R1999&qid=1659554334857#d1e2253-01-04-PAR5> .

